class FakeApi implements Api {

  FakeApi([dynamic]); //injector constructor

  @override
  Future<ApiResult>
  getPhotos(int page) async {
    print('[fake photos] get, page: $page of ${_pages.length}, per page: $_photosPerPage, delay: $_fakeDelay, error possibility: $_errorPossibility%');
    try {
      final response = _process(
          Query(Uri.parse('fake://photos?page=$page&per_page$_photosPerPage'), page, _photosPerPage));
      print(' respone: $response');
      return await Future.delayed(_fakeDelay,
          Random.secure().nextInt(100) > _errorPossibility
              ? () => ApiResult.well(response, page == _pages.length)
              : () => throw 'a Fake Network error');
    } on String catch (msg) {
      print('handle msg $msg');
      return ApiResult.bad(msg);
    } catch (err, stackTrace) {
      print('handle error $err, $stackTrace');
      return ApiResult.bad(err.toString());
    }
  }

  Response
  _process(Query query) {
    print('[fake photos] process, query: $query');
    assert(query.page <= _pages.length , 'No more data');
    final responseBody =  _pages[query.page-1];
    final jsonResponse = json.decode(responseBody);
    final data = jsonResponse as List;
    return Response(query,
        data.map((item) => Foto.from(item, item['user'], item['urls'])),
        rateLimit: 500,
        rateLimitRemaining: 499
    );
  }

  @override
  dispose() {}

}
